import styled from 'styled-components';

export const StyledBody = styled.div`
    margin-top: 8vh;
    display: flex;
    padding: 5rem 0; 

    @media (max-width: 768px) {
        margin-top: 0vh;
        padding: 0; 
    } 
`;
